  render() {
    return (
      <div style={{ width: '40%', display: 'inline-block' }}>
        <h2 style={{ color: 'defaultTextColor' }}>Number Text</h2>
      </div >
    );
  }
}

class Filter extends Component {
  render() {
    return (
      <div>
        <img src="#" alt="#" />
        <input type="text" />
      </div>
    );
  }
}

class App extends Component {


  render() {
    return (
      <div className="App">
        <h1>Title</h1>
        <Aggregate />
        <Aggregate />
        <Filter />
      </div>
    );
  }
}

export default App;
